import React from 'react';

class CoinListItem extends React.Component {

    state = {
        coins: []
      }

    componentDidMount() {
        fetch('/coins')
        .then(res => res.json())
        .then((data) => {
          this.setState({ coins: data })
        })
        .catch(console.log)
    }
}


export default CoinListItem
